void clicked()
{
    Args args;
    FormRun formRun;
    HMCase  hmCase1;
    HMPatientChargeEntryTable chargeTable;

    super();

    args = new args(formstr(HMPatientChart));
    args.caller(element);
    args.record(HMPatient_1);
    formrun = classfactory.formrunclass(args);
    formrun.init();
    formrun.run();
    formrun.wait();
    formrun.detach();
}

/// <summary>
///
/// </summary>
public void jumpRef()
{
    super();
    Args            args = new Args();
    HMClaimTable	_hmClaimTable;
    MenuFunction    menuFunction;

    select firstonly _hmClaimTable
        where _hmClaimTable.ClaimID == this.text();

    args.lookupRecord(_hmClaimTable);
    args.caller(element);

    menuFunction = new MenuFunction(menuItemDisplayStr(HMAllClaims), MenuItemType::Display);
    menuFunction.run(args);

}

